import {
  FileText,
  Unlock,
  Circle,
  Settings,
  User,
  HelpCircle,
  Info,
  DollarSign,
  Clipboard,
  Mail,
  File
} from 'react-feather'
export default [
  {
    id: 'account',
    title: 'Account',
    icon: <User />,
    children: [
      {
        id: 'connect',
        title: 'Connect Wallet',
        icon: <Info />,
        navLink: '/pages/account-settings/InfoTabContent'
      },
      {
        id: 'earnings',
        title: 'My Earnings',
        icon: <DollarSign />,
        navLink: '/pages/earnings'
      },
      {
        id: 'knowledgeBase',
        title: 'My Campaigns',
        icon: <Info />,
        navLink: '/pages/knowledge-base',
        parentOf: ['/pages/knowledge-base/category/questions', '/pages/knowledge-base/category']
      },
      {
        id: 'screens',
        title: 'My Screens',
        icon: <Circle />,
        navLink: '/pages/screens'
      },
      {
        id: 'stream',
        title: 'My Stream',
        icon: <Circle />,
        navLink: '/pages/stream'
      },
     {
        id: 'vip',
        title: 'VIP Badges',
        icon: <Clipboard />,
        navLink: '/pages/account-settings/ConnectionsTabContent',
        parentOf: ['/pages/connect', '/pages/connect']
      }
    ]
  }
]
